import React from 'react';
import '../components/ProjectCard.css';
import Rose from '../components/rose.jpg';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import ListGroup from 'react-bootstrap/ListGroup';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
// React component for the frontside of the card
class ProjectCard extends React.Component {
  render() {
   return(
     <React.Fragment>

     <Card style={{ marginTop: '10%', width: '18rem' }}>
      <Card.Img variant="top" src={Rose} />
     <Card.Body>
     <Card.Title>YelpCamp</Card.Title>
    <Card.Text>
      Some quick example text to build on the card title and make up the bulk of
      the card's content.
    </Card.Text>
    <Button variant="invisible">Go somewhere</Button>
  </Card.Body>
</Card>
  </React.Fragment>  

    );
  }
 }

 export default ProjectCard;
